import React, {useState}from 'react';



const Remort = () => {
    const[count, setCount] = useState(0);

    const call1 = () => setCount(count+1);
    const call2 = () => setCount(count-1);
    

    return (
        <div>
           <div className='row justify-content-center'>
               <div className='col-4 border border-primary d-flex justify-content-between p-5'>
                   <div>
                       <button className='px-3 py-1 bg-success fs-4 text-light' 
                       onClick={call1}>+</button>
                   </div>
                   <div>
                       <h1>{count}</h1>
                   </div>
                   <div>
                       <button className='px-3 py-1 bg-danger fs-4 text-light'
                        onClick={call2}>-</button>
                   </div>
                    <button className='px-3 py-1 bg-warning fs-4 text-light'>
                        Reset
                    </button>
                  
               </div>
           </div>
        </div>
    );
}

export default Remort;
